INSERT INTO `bonus` VALUES (1,1,'1.0GB Uploaded',2500.0,'With enough bonus points acquired, you are able to exchange them for an Upload Credit. The points are then removed from your Bonus Bank and the credit is added to your total uploaded amount.','traffic',1073741824,0.0,'yes',2500.0,'yes',0),(2,2,'2.5GB Uploaded',6250.0,'With enough bonus points acquired, you are able to exchange them for an Upload Credit. The points are then removed from your Bonus Bank and the credit is added to your total uploaded amount.','traffic',2684354560,0.0,'yes',6250.0,'yes',0),(3,3,'5GB Uploaded',12500.0,'With enough bonus points acquired, you are able to exchange them for an Upload Credit. The points are then removed from your Bonus Bank and the credit is added to your total uploaded amount.','traffic',5368709120,0.0,'yes',12500.0,'yes',0),(4,28,'3 Invites',15000.0,'With enough bonus points acquired, you are able to exchange them for a few invites. The points are then removed from your Bonus Bank and the invitations are added to your invites amount.','invite',3,1.0,'yes',15000.0,'no',1),(5,29,'Custom Title!',50.0,'For only 50.0 Karma Bonus Points you can buy yourself a custom title. the only restrictions are no foul or offensive language or userclass can be entered. The points are then removed from your Bonus Bank and your special title is changed to the title of your choice','title',1,1.0,'yes',50.0,'no',0),(6,21,'VIP Status',100000.0,'With enough bonus points acquired, you can buy yourself VIP status for one month. The points are then removed from your Bonus Bank and your status is changed.','class',1,1.0,'yes',100000.0,'no',0),(7,30,'Give A Karma Gift',100.0,'Well perhaps you dont need the upload credit, but you know somebody that could use the Karma boost! You are now able to give your Karma credits as a gift! The points are then removed from your Bonus Bank and added to the account of a user of your choice!\r\n\r\nAnd they recieve a PM with all the info as well as who it came from...','gift_1',1073741824,1.0,'yes',100.0,'no',0),(8,31,'Custom Smilies',300.0,'With enough bonus points acquired, you can buy yourself a set of custom smilies for one month! The points are then removed from your Bonus Bank and with a click of a link, your new smilies are available whenever you post or comment!','smile',1,1.0,'yes',300.0,'no',0),(9,24,'Remove Warning',5000.0,'With enough bonus points acquired... So you have been naughty... tsk tsk :P Yep now for the Low Low price of only 5000 points you can have that warning taken away lol.!','warning',1,1.0,'no',5000.0,'no',0),(10,25,'Ratio Fix',1500.0,'With enough bonus points acquired, you can bring the ratio of one torrent to a 1 to 1 ratio! The points are then removed from your Bonus Bank and your status is changed.','ratio',1,1.0,'no',1500.0,'no',0),(11,15,'FreeLeech',2000000.0,'The Ultimate exchange if you have over 2000000 Points - Make the tracker freeleech for everyone for 3 days: Upload will count but no download.\r\nIf you dont have enough points you can donate certain amount of your points until it accumulates. Everybodys karma counts!','freeleech',1,115200.0,'yes',100.0,'no',0),(12,16,'Doubleupload',1000000.0,'The Ultimate exchange if you have over 1000000 points - Make the tracker double upload for everyone for 3 days: Upload will count double.\r\nIf you dont have enough points you can donate certain amount of your points until it accumulates. Everybodys karma counts!','doubleup',1,468750.0,'yes',100.0,'no',0),(13,17,'Halfdownload',1000000.0,'The Ultimate exchange if you have over 1000000 points - Make the tracker Half Download for everyone for 3 days: Download will count only half.\r\nIf you dont have enough points you can donate certain amount of your points until it accumulates. Everybodys karma counts!','halfdown',1,142467.0,'no',100.0,'no',0),(14,10,'1.0GB Download Removal',275.0,'With enough bonus points acquired, you are able to exchange them for a Download Credit Removal. The points are then removed from your Bonus Bank and the download credit is removed from your total downloaded amount.','traffic2',1073741824,1.0,'yes',275.0,'no',0),(15,11,'2.5GB Download Removal',350.0,'With enough bonus points acquired, you are able to exchange them for a Download Credit Removal. The points are then removed from your Bonus Bank and the download credit is removed from your total downloaded amount.','traffic2',2684354560,1.0,'yes',350.0,'no',0),(16,12,'5GB Download Removal',550.0,'With enough bonus points acquired, you are able to exchange them for a Download Credit Removal. The points are then removed from your Bonus Bank and the download credit is removed from your total downloaded amount.','traffic2',5368709120,1.0,'yes',550.0,'no',0),(17,32,'Anonymous Profile',25000.0,'With enough bonus points acquired, you are able to exchange them for Anonymous profile for 28 days. The points are then removed from your Bonus Bank and the Anonymous switch will show on your profile.','anonymous',1,1.0,'yes',5000.0,'no',0),(18,18,'Freeleech for 1 Year',2000000.0,'With enough bonus points acquired, you are able to exchange them for Freeleech for one year for yourself. The points are then removed from your Bonus Bank and the freeleech will be enabled on your account.','freeyear',1,1.0,'no',2000000.0,'no',0),(19,33,'3 Freeleech Slots',2500.0,'With enough bonus points acquired, you are able to exchange them for some Freeleech Slots. The points are then removed from your Bonus Bank and the slots are added to your free slots amount.','freeslots',3,0.0,'yes',2500.0,'no',0),(20,34,'200 Bonus Points - Invite trade-in',1.0,'If you have 1 invite and dont use them click the button to trade them in for 200 Bonus Points.','itrade',200,0.0,'yes',0.0,'no',0),(21,35,'Freeslots - Invite trade-in',1.0,'If you have 1 invite and dont use them click the button to trade them in for 2 Free Slots.','itrade2',2,0.0,'no',0.0,'no',0),(22,26,'Pirate Rank for 2 weeks',100000.0,'With enough bonus points acquired, you are able to exchange them for Pirates status and Freeleech/DoubleUp for 2 weeks. The points are then removed from your Bonus Bank and the Pirate icon will be displayed throughout, freeleech/doubleup will then be enabled on your account.','pirate',1,1.0,'yes',100000.0,'no',0),(23,19,'King Rank for 1 month',200000.0,'With enough bonus points acquired, you are able to exchange them for Kings status and Freeleech/DoubleUp for 1 month. The points are then removed from your Bonus Bank and the King icon will be displayed throughout,  freeleech/doubleup will then be enabled on your account.','king',1,1.0,'yes',200000.0,'no',0),(24,4,'10GB Uploaded',25000.0,'With enough bonus points acquired, you are able to exchange them for an Upload Credit. The points are then removed from your Bonus Bank and the credit is added to your total uploaded amount.','traffic',10737418240,0.0,'yes',25000.0,'yes',0),(25,5,'25GB Uploaded',62500.0,'With enough bonus points acquired, you are able to exchange them for an Upload Credit. The points are then removed from your Bonus Bank and the credit is added to your total uploaded amount.','traffic',26843545600,0.0,'yes',62500.0,'yes',0),(26,6,'50GB Uploaded',125000.0,'With enough bonus points acquired, you are able to exchange them for an Upload Credit. The points are then removed from your Bonus Bank and the credit is added to your total uploaded amount.','traffic',53687091200,0.0,'yes',125000.0,'yes',0),(27,7,'100GB Uploaded',250000.0,'With enough bonus points acquired, you are able to exchange them for an Upload Credit. The points are then removed from your Bonus Bank and the credit is added to your total uploaded amount.','traffic',107374182400,0.0,'yes',250000.0,'yes',0),(28,8,'520GB Uploaded',1000000.0,'With enough bonus points acquired, you are able to exchange them for an Upload Credit. The points are then removed from your Bonus Bank and the credit is added to your total uploaded amount.','traffic',558345748480,0.0,'yes',1000000.0,'yes',0),(29,9,'1TB Uploaded',2000000.0,'With enough bonus points acquired, you are able to exchange them for an Upload Credit. The points are then removed from your Bonus Bank and the credit is added to your total uploaded amount.','traffic',1099511627776,0.0,'yes',2000000.0,'yes',0),(30,27,'Parked Profile',5000.0,'With enough bonus points acquired, you are able to unlock the parked option within your profile which will ensure your account will be safe. The points are then removed from your Bonus Bank and the parked switch will show on your profile.','parked',1,1.0,'yes',5000.0,'no',0),(31,20,'Pirates bounty',75000.0,'With enough bonus points acquired, you are able to exchange them for Pirates bounty which will select random users and deduct random amount of reputation points from them. The points are removed from your Bonus Bank and the reputation points will be deducted from the selected users then credited to you.','bounty',1,1.0,'yes',75000.0,'no',0),(32,36,'100 Reputation points',60000.0,'With enough bonus points acquired, you are able to exchange them for some reputation points. The points are then removed from your Bonus Bank and the rep is added to your total reputation amount.','reputation',100,0.0,'yes',60000.0,'no',0),(33,22,'Userblocks',5000.0,'With enough bonus points acquired and a minimum of 50 reputation points, you are able to exchange them for userblocks access. The points are then removed from your Bonus Bank and the user blocks configuration link will appear on your menu.','userblocks',0,0.0,'yes',5000.0,'no',0),(34,37,'Bump a Torrent!',5000.0,'With enough bonus points acquired, you can Bump a torrent back to page 1 of the torrents page, bringing it back to life! \r\nThe torrent will then appear on page 1 again! The points are then removed from your Bonus Bank and the torrent is Bumped!\r\n** note there is an option to either view Bumped torrents or not.','bump',1,0.0,'yes',5000.0,'no',0),(35,38,'Immunity',250000.0,'With enough bonus points acquired, you are able to exchange them for immunity for one month. The points are then removed from your Bonus Bank and the immunity switch is enabled on your account.','immunity',1,0.0,'no',250000.0,'no',0),(36,23,'User Unlocks',500.0,'With enough bonus points acquired and a minimum of 50 reputation points, you are able to exchange them for bonus locked moods. The points are then removed from your Bonus Bank and the user unlocks configuration link will appear on your menu.','userunlock',1,0.0,'yes',500.0,'no',0),(37,13,'50GB Download Removal',5500.0,'With enough bonus points acquired, you are able to exchange them for a Download Credit Removal. The points are then removed from your Bonus Bank and the download credit is removed from your total downloaded amount.','traffic2',53687091200,1.0,'yes',5500.0,'no',0),(38,14,'100GB Download Removal',11000.0,'With enough bonus points acquired, you are able to exchange them for a Download Credit Removal. The points are then removed from your Bonus Bank and the download credit is removed from your total downloaded amount.','traffic2',107374182400,1.0,'yes',11000.0,'no',0);
